import React from 'react';
import Input from './Form/Input';

export const App = () => {
  const [cep, setCep] = React.useState('');

  return (
    <>
      <form>
        <Input
          type="text"
          label="CEP"
          id="cep"
          placeholder="00000-000"
          value={cep}
          setValue={setCep}
          onBluer
        />
      </form>
      <p>{cep}</p>
      <button>Enviar</button>
    </>
  );
};

export default App;
